import React, { Component } from 'react';
import Button from '@material-ui/core/Button';
import red from '@material-ui/core/colors/red';
import Menu_principal from '../components/Menu_principal'
class Continuar_bot extends Component{
    render(){
        
        return (           
            // <button onclick="newBiblioteca()">Continuar</button> 
            <Button variant="contained" color="primary" a={Menu_principal}>
                     Continuar

            </Button>
         
        );
    }
    
}

export default Continuar_bot;

